def calculate_median(numbers):
    """"""
    numbers = [i for i in numbers if isinstance(i, (int, float))]
    n = len(numbers)
    if n == 0:
        return 'Error: No numerical values found in array.'
    numbers.sort()
    if n % 2 == 0:
        median = (numbers[n // 2 - 1] + numbers[n // 2]) / 2
    else:
        median = numbers[n // 2]
    return median
